import React from "react";
import "./Columns.css";

function Columns() {
  return (
    <div className="columns-container">
      <div className="column">
        <h2>Column 1</h2>
        {/* You can add tiles for Column 1 here */}
      </div>
      <div className="column">
        <h2>Column 2</h2>
        {/* You can add tiles for Column 2 here */}
      </div>
      <div className="column">
        <h2>Column 3</h2>
        {/* You can add tiles for Column 3 here */}
      </div>
      <div className="column">
        <h2>Column 4</h2>
        {/* You can add tiles for Column 4 here */}
      </div>
    </div>
  );
}

export default Columns;
